# Assign values to the variables
def testfn(matrix,k,nth):
    n = int(len(matrix)/nth)
    for j in range(n):
        for i in range(matrix[n*k+j][2]):
            variables[f"var{i}"] = rm.randint(5*i,10*i)
            matrix[n*k+j][0].append(variables[f"var{i}"])

